import React from 'react'
import Profilepic from '../image/1.jpg'

const Profile = () => {
    return (
        <div>
          
            <center><h1>Profile</h1></center>
            <center><img src ={Profilepic} class="rounded-circle" alt="Cinque Terre" width="50px" height="236"/></center>
            <center><p className="filename">Pacahraphon Software</p></center>
            
        </div>
    )
}

export default Profile
